import React from 'react';

const TodoList = () => {
  return (
    <div>
      <h1 className="text-3xl font-bold mb-4">Todo List</h1>
      <p>Manage your tasks and get AI-powered suggestions.</p>
    </div>
  );
};

export default TodoList;
